import Test from "./comp/Test";
import Form from "./comp/Form";


import './App.css';
import Numbertoword from "./comp/Numbertoword";
import Details from "./comp/Details";

function App(props) {
  return (
    <div className='App'>
      <Test/>
      <div className="App">
      <Form/>
      </div>
      <Numbertoword/>
      <Details/>
    </div>
);
}


export default App;
